Gadael yr 20fed Ganrif

Arts Documentary hosted by Gareth Potter, published by S4C in 2014 - Welsh narration


Information
------------------------------

We follow Gareth Potter as he takes a journey through thirty years of Welsh music history. In this semi-autobiographical account we see how the Welsh underground scene not only shaped Gareth's life but helped influence a generation of young artists.

